import React, { createContext, useContext } from "react";
import { WrapperStore } from "./Store"

const Wrapper = () => {
    const { wrapperDispatch, wrapperState: { wrapper } } = useContext(WrapperStore);
    console.log(wrapper)
    const Store = createContext(wrapper)
    const { dispatch, state: { todo } } = useContext(Store);
    return (<div>hola</div>)
}

export default Wrapper;
